    oper = 1
    for (k, customer) in enumerate(orders):
        if customer in tables:
            continue
        oper += 1
        if len(tables) < N:
            tables.add(customer)
            continue
        tmp = tables.copy()
        for j in range(k + 1, M):
            if len(tmp) == 1:
